import base64
import pytest
from image_output.src.image_output import ImageOutput


class TestImageOutput:

    def setup_method(self):
        self.component = ImageOutput()

    def test_run_valid_base64_png(self):
        png_data = """data:image/png;base64,"""

        result = self.component.run(png_data)

        assert result == png_data, "The output should match the input base64 string"

    def test_run_empty_string(self):
        result = self.component.run("")
        assert result == "", "Empty input should return an empty output"

    def test_run_invalid_base64(self):
        invalid_base64 = "not_base64"

        with pytest.raises(ValueError, match="Invalid base64 string"):
            self.component.run(invalid_base64)
